s =""
t = ""

class Solution:

    def minWindow(self, s: str, t: str) -> str:
        minimum_char_list = []
        minimum_index_list = []
        for i in range(len(s)):
            if s[i] in t:
                minimum_char_list.append(s[i])
                minimum_index_list.append(i)
        start = 0
        end = 0
        t_count = len(t)
        minimum_size = sys.maxsize
        founded = False

        #added
        t_result = []
        for i_t in t:
            t_result.append(i_t)

        t = t_result

        for j in range(len(minimum_char_list) - t_count+1):
           k = 0
           temp_t = t[:]

           temp_start = 0
           temp_end = 0
           while(j+k < len(minimum_char_list)):
               #if(t and minimum_char_list[j+k] == temp_t[0]):
               if (t and minimum_char_list[j + k] in temp_t):
                   if(len(temp_t) == t_count):
                      temp_start = j+k
                   #temp_t = temp_t[1:]
                   #current_index = temp_t.find(minimum_char_list[j + k])
                   #temp_t= temp_t[:current_index]+temp_t[current_index+1:]
                   temp_t.remove(minimum_char_list[j + k])

                   if (len(temp_t) == 0):
                      temp_end = j+k
                      distance = minimum_index_list[temp_end] - minimum_index_list[temp_start]
                      founded = True
                      if(minimum_size > distance ):
                          minimum_size = distance
                          start = temp_start
                          end = temp_end

                      break

               k = k+1
        if founded:
            return s[minimum_index_list[start]:minimum_index_list[end]+1]
        else:
            return ""


